pub(crate) enum Opcode { GetDeferredData, Event, // ... and other ops
}
#[derive(rkyv::Archive, rkyv::Serialize, rkyv::Deserialize)]
pub struct DeferredData { pub spec: u32, pub description: xous_ipc::String::<128>,
} // lib.rs:
impl MyService { // ... new(), etc. pub fn get_data_blocking(&self, spec: u32) -> Result<String, xous::Error> { let mut rec = DeferredData { spec, description: xous_ipc::String::new(), }; let mut buf = Buffer::into_buf(rec).or(Err(xous::Error::InternalError))?; buf.lend_mut(self.conn, Opcode::GetDeferredData.to_u32().unwrap()).map(|_| ())?; let response = buf.as_flat::<DeferredData, _>().unwrap(); Ok(String::new(response.description.as_str().unwrap_or("UTF-8 error"))) }
} // main.rs:
fn xmain() -> ! { // ... preamble // if you are sure there will never be multiple deferred messages, you can just use an // Option<MessageEnvelope> and .take() to remove it from scope, instead of Vec and .drain() let mut storage = Vec::<xous::MessageEnvelope>::new(); let mut spec: u32 = 0; loop { let mut msg = xous::receive_message(sid).unwrap(); match FromPrimitive::from_usize(msg.body.id()) { /// This will get processed whenever the server gets scheduled, which has no strict /// relationship to the caller's state. However, messages are guaranteed /// to be processed in-order. Some(Opcode::GetDeferredData) => { spec += { // any incoming arguments are processed in a block like this to ensure // that the `msg` has no ownership interference with `spec`. let buffer = unsafe { Buffer::from_memory_message(msg.body.memory_message().unwrap()) }; let data = buffer.to_original::<DeferredData, _>().unwrap(); data.spec }; storage.push(msg); // `msg` is now pushed into the scope of `storage`, which prevents `Drop` // from being called, thus continuing to block the caller. }, // ... other processing happens, perhaps guided by the value in `spec` Some(Opcode::Event) => { let result = DeferredData { spec: 0, description: xous_ipc::String::from_str("something happened!"), }; // `drain()` takes `msg` back out of the scope of `storage`, and // unless it is bound to another variable outside of this scope, // it will Drop and unblock the caller at the end of this block. for mut sender in storage.drain(..) { let mut response = unsafe { Buffer::from_memory_message_mut(sender.body.memory_message_mut().unwrap()) }; response.replace(result).unwrap(); } } // .. other match statements } } // ... postamble
}

